import { actionTypes } from "../actions/loading.action";

const initialState = {
  ITEMS: []
}

export default (state = initialState, {type, data}) => {
  switch (type) {
    
    case actionTypes.ITEMS:
      return console.log(data);

    default:
      return state;
  }
}
